import React from "react";
import '../App.css';

function WizardPage() {
  return (
    <div className="homepage">
      <header>
        <h1>Welcome Wizards</h1>
      </header>
      <main>
        <p>Together we can spread spells and misinformation.</p>
      </main>
    </div>
  );
}

export default WizardPage;
